                        "Desc": "チーム内に<color style='color:#FF9999;'>炎元素</color>、<color style='color:#80C0FF;'>水元素</color>、<color style='color:#FFACFF;'>雷元素</color>、<color style='color:#99FFFF;'>氷元素</color>のキャラクターが1名以上いる時、それぞれの元素タイプのキャラクター数に応じて、元素爆発<color style='color:#FFD780;'>秘器・狩人の七つ道具</color>の<color style='color:#FFD780;'>家庭用肉球アシスタントマシン</color>が強化される。<br>ヤフォダはチーム内の上記元素タイプのキャラクターをこっそり記録する。これらのキャラクターのうち、最も多い元素タイプはそれぞれ次のような効果を発動する。<br>・<color style='color:#FF9999;'>炎元素</color>：<color style='color:#FFD780;'>家庭用肉球アシスタントマシン</color>のダメージが130%になる。<br>・<color style='color:#80C0FF;'>水元素</color>：<color style='color:#FFD780;'>家庭用肉球アシスタントマシン</color>が与える治療量が120%になる。<br>・<color style='color:#FFACFF;'>雷元素</color>：<color style='color:#FFD780;'>家庭用肉球アシスタントマシン</color>の数が1個増える。<br>・<color style='color:#99FFFF;'>氷元素</color>：<color style='color:#FFD780;'>家庭用肉球アシスタントマシン</color>の攻撃間隔が10%短くなる。<br><br>上記元素タイプのキャラクター数が等しい場合、<color style='color:#FF9999;'>炎元素</color>、<color style='color:#80C0FF;'>水元素</color>、<color style='color:#FFACFF;'>雷元素</color>、<color style='color:#99FFFF;'>氷元素</color>の順番で記録する。初期状態では、1種類の元素タイプの効果のみ発動できる。",
